import React, { useState } from 'react';
import { useSelector,RootStateOrAny } from 'react-redux';
import { Spinner } from '../components/Spinner/Spinner' 
import { Information } from '../components/Profile/Information';
import { PersonalSideBar } from '../components/PersonalSideBar';

type Props = {};

export const Profile = (props: Props) => {


  const userDetail = useSelector((state: RootStateOrAny) => state.loginReducer);
  const { loading } = userDetail;
  const [tabs, setTabs] = useState<number>(1);
  
  return <div>

    {loading 
    ? <Spinner />
    : ( 

      <div className='max-w-7xl flex px-10 m-auto'>
        <section className=' w-1/3 max-w-xs '>
          <PersonalSideBar tabs={tabs} setTabs={setTabs} />
        </section>
        
        
        <section className='w-full' style={tabs === 1 ? {display: 'block'} : {display: 'none'}}>
          <Information />
        </section>

      </div>
    
  )
}

   
    
</div>;
};
